@-moz-document url-prefix("https://www.velocidactil.es/index.php?L=run&modo=reto&usuarios_retados=") {
#vdactil_text_type {
    font-family: Roboto;
    font-size: 18px;
    font-weight: bold;
    display: flow;
    top: 1em;
    left: 3em;
    color: #fff !important;
    text-align: left;
    padding: 5px;
    min-width: 200px;
}
.movie {
    z-index: 99;
    background-color: #333 !important;
    position: relative;
}
td,
p {
    font: 12px "Lucida Grande", verdana, helvetica, arial, sans-serif;
    margin: 0px;
    background-color: #333 !important;
}
.box_round {
    background-color: #333 !important;
    padding: 15px;
    min-width: 200px;
}
.velocityName {
    color: #669acc !important;
    font-size: 17px;
    font-family: Verdana, Arial, Helvetica, sans-serif;
    font-weight: bold;
}
.vdactil_nickname {
    width: 75px;
    height: 24px;
    padding-left: 8px;
    font-family: Arial, Helvetica, sans-serif;
    font-size: 12px;
    line-height: 24px;
    color: #669acc !important;
    clear: none;
    float: left;
    top: 1em;
    left: 3em;
}
img {
    border: 0;
    visibility: inherit !important;
}
element.style {
    cursor: default;
    font-weight: bold;
    color: #2980b9 !important;
}
element.style {
    cursor: default;
    font-weight: bold;
    color: #2980b9 !important;
}
art-main.table {
    font-family: Verdana, Geneva, Arial, Helvetica, Sans-Serif;
    font-style: normal;
    font-weight: normal;
    font-size: 12px;
    text-align: justify;
    background-color: #333 !important
}
#art-main,
table {
    font-family: Verdana, Geneva, Arial, Helvetica, Sans-Serif;
    font-style: normal;
    font-weight: normal;
    font-size: 12px;
    text-align: justify;
}
table.golden {
    border-collapse: collapse;
    border: 2px solid #996;
    font: normal 80%/140% verdana, arial, helvetica, sans-serif;
    color: darkgray !important;
    background: #fffff0;
    width: 100%;
}
.mejorTexto {
    margin: 4px auto;
    max-width: 400px;
    -webkit-box-shadow: 3px 3px 3px 1px #c0c0c0;
    box-shadow: 3px 3px 3px 1px #c0c0c0;
    border: 1px solid gray;
    -webkit-border-radius: 7px;
    border-radius: 7px;
    position: fixed;
    background-color: #7EE9F1;
    color: #a9a9a9 !important;
    text-align: left;
    font-family: Verdana, Helvetica, sans-serif;
    font-size: 14px;
    font-weight: bold;
    padding: 15px;
    white-space: nowrap;
    right: 7px !important;
    top: 3px !important;
    display: none;
    z-index: 9999;
}
td.golden,
th.golden {
    border: 1px solid #4b8ad2;
    padding: .3em;
}
table.golden {
    border-collapse: collapse;
    border: 2px solid #996;
    font: normal 80%/140% verdana, arial, helvetica, sans-serif;
    color: #fdfdfd !important;
    background: #fffff0;
    width: 100%;
}
.odd {
    color: #fff;
    background: #f7f5dc;
}
.gaus {
    color: #669acc !important;
    text-shadow: 0 0 20px #222;
}
a {
    color: #c3c1c1;
    text-decoration: none;
}
a.info:hover span {
    border: 3px solid #909090;
    display: block;
    position: absolute;
    top: 4em;
    left: -9em;
    background-color: #EEEEEE;
    color: #b5adad;
}
a.info:hover {
    z-index: 31;
    color: #cebaba;
    font-weight: bold;
}
#semaforo {
    margin: 4px auto;
    width: 250px;
    height: 140px;
    left: 40%;
    top: 40%;
    border: 3px solid rgb(132 128 128);
    display: block;
    position: absolute;
    background-color: #333;
    /* color: #000000; */
    text-align: left;
    font-family: Verdana, Helvetica, sans-serif;
    font-size: 10px;
    padding: 5px;
    z-index: 0 !important;
    -webkit-border-radius: 12px;
    border-radius: 12px;
    min-width: 200px;
    -moz-opacity: 0.9;
    opacity: 1;
}
#countDown {
    color: #bbd4f9;
    font-size: 17px;
    font-family: Arial, Helvetica, sans-serif;
    font-weight: bold;
    text-align: center;
}
#copyright {
    font: 10px Arial, Helvetica, sans-serif;
    color: #b9b5b5;
}
element.style {
    background-color: #333;
    opacity: 1;
    border-top: 1px solid gray;
}
.art-footer a,
.art-footer a:link {
    color: #859db9;
    text-decoration: none;
}
.active_word {
    color: #669acc;
    text-decoration: underline;
}
#chat_self_nickname {
    color: #609ee4;
    font-weight: bold;
}
.chatContentBlock {
    color: #eae2e2;
}
#chat_nickname {
    color: #4b8ad2;
}
.art-sheet-tr,
.art-sheet-tl,
.art-sheet-br,
.art-sheet-bl {
    width: 52px;
    height: 52px;
    background-image: none !important;
}
.art-sheet-tc,
.art-sheet-bc {
    left: 26px;
    right: 26px;
    height: 52px;
    background-image: none !important;
}
.art-sheet-cr,
.art-sheet-cl {
    top: 26px;
    bottom: 26px;
    width: 52px;
    background-image: none !important;
}
.art-sheet-cc {
    position: absolute;
    top: 26px;
    left: 26px;
    right: 26px;
    bottom: 26px;
    background-color: #212121 !important;
}
.clockCounter {
    width: 330px;
    color: #669acc;
}
}

